    <>
    <BrowserRouter>
    <Routes> 
      <main style={{marginLeft: "200px"}}>
        <InputToDo value={data} />
        <Display myFunc={receiveData}/>
      </main></Routes>
      </BrowserRouter>
    </>
  );
};

export default App;
